-- Function: sample.testdata_load_sample(text, text, text, integer)

-- DROP FUNCTION sample.testdata_load_sample(text, text, text, integer);

CREATE OR REPLACE FUNCTION sample.testdata_load_sample(p_surveyref text, p_state text, p_sampleunittype text, p_bulk_times integer)
  RETURNS text AS
$BODY$
DECLARE 
v_state text;
v_surveyref text;
v_exercise_name text;
v_bulk_times integer;
v_sampleunittype text;
v_rows integer;
v_message text;
BEGIN

v_surveyref       := p_surveyref;
v_bulk_times      := p_bulk_times;
v_sampleunittype  := p_sampleunittype;

-- select * from sample.testdata_load_sample('221','INIT','B',1)

v_message := 'Data for Surveyref: ' || v_surveyref;


SELECT state 
FROM sample.sampleunitstate 
WHERE state = p_state INTO v_state;

SELECT  nextval('sample.samplesummaryseq')
      , v_surveyref
      , now()
      , NULL
      , 'ACTIVE'
      , now();

--Repeat if request to bulk data

FOR v_loop IN 1..v_bulk_times LOOP
END LOOP;

SELECT COUNT(*) FROM sample.sampleunit s INTO v_rows;

v_message := v_message || ' (500*' || v_bulk_times || ' RECORDS INSERTED. TOTAL RECORDS sample.sampleunit = ' || v_rows ||')';

RETURN v_message;

 EXCEPTION
 WHEN OTHERS THEN  
    RETURN SQLERRM || ' SQLSTATE : ' || SQLSTATE ;
    
END;
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;
